  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEMs created for this project were developed using the NOAA National Weather
  Service's Weather Forecast Office (WFO) boundaries. Because the WFO boundaries can
  cover large areas, the WFO DEM was divided into smaller DEMs to ensure more manageable
  file sizes. The Seattle (WA) WFO DEM was split into three smaller DEMs. They are
  divided along county lines and are: 1. Seattle (WA) WFO - Grays Harbor County 2.
  Seattle (WA) WFO - Clallam, Jefferson, Kitsap, Mason, Pierce, and Thurston Counties
  3. Seattle (WA) WFO - Whatcom, San Juan, Skagit, Island, Snohomish, and King Counties
  This metadata record describes the DEM for Seattle (WA) WFO - Grays Harbor County.
  The DEM includes the best available lidar data known to exist at the time of DEM
  creation for the coastal areas of Grays Harbor County, that met project specifications.
  The DEM is derived from LiDAR datasets collected for the Puget Sound LiDAR Consortium
  (PSLC), United States Geological Survey (USGS) and the Oregon Department of Geology
  and Mineral Industries (DOGAMI), available from the NOAA Digital Coast. Hydrographic
  breaklines used in the creation of the DEM were delineated using LiDAR intensity
  imagery generated from each constituent dataset. The DEMs are hydro flattened such
  that water elevations are less than or equal to 0 meters. The DEM is referenced
  vertically to the North American Vertical Datum of 1988 (NAVD88) with vertical units
  of meters and horizontally to the North American Datum of 1983 (NAD83). The resolution
  of the DEM is approximately 5 meters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
